import './css/home.css'
import './css/tailwind.css'

class CHome extends React.Component
{

    Logo()
    {
        return <div className="Logo mt-10 bg-no-repeat bg-contain" />
    }
    AboutUs()
    {
        return <div> <p>The Uruk project is a highly motivated community of people sharing a strong interest in free culture and free society. We all help each other and share the common purpose of supporting and building free projects. The Uruk project provides a list of goals our members follow in order to promote and strengthen free (as in freedom!) software and culture.
        The Uruk name was chosen in honor of Uruk (Warka) city in Iraq (Read More)
        To indicate how the word "uruk" should be pronounced, we included an audio file</p></div>
    }
    render(){
        return <div className="flex sticky z-10 justify-between flex-row-reverse items-center w-full h-full ">
            <this.Logo/>
            <this.AboutUs/>
        </div>
    }
}
export default CHome
